// import React, { useState } from 'react';
import "./App.css";
import Data from "./data.json";
import Graphic from "./components/Graphic"

function findMinMax(props) {
  var lowestX, lowestY = Number.POSITIVE_INFINITY;
  var highestX, highestY = Number.NEGATIVE_INFINITY;
  var tmpX, tmpY;
  for (var i = props.length-1; i>=0; i--) {
    tmpX = props[i].x;
    tmpY = props[i].y;
    if (tmpX < lowestX) lowestX = tmpX;
    if (tmpX > highestX) highestX = tmpX;
    if (tmpY < lowestY) lowestY = tmpY;
    if (tmpY > highestY) highestY = tmpY;
  }
  console.log(`x range: ${lowestX}, ${highestX}`);
}

function App() {

  //user defined
  const radius = 5;
  const fontSize = 20;

  //data is initially set to imported json array Data
  const src = Data;

  return (
    <>
      <Graphic src={src} radius={radius} fontSize={fontSize}/>
    </>
  );
}

export default App;
